import React from 'react'
import './Card.css'

function Card({title, body, space}) {
    return (
        <div className="card">
            <div className="card-grid">
                <div className="card-img col">
                    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e9/Blue_Moon_beer_with_orange.jpg/800px-Blue_Moon_beer_with_orange.jpg" alt="Imagen del cohete"></img>
                </div>
                <div className="card-body text-center">
                    <div className="card-title">
                        {title}
                    </div>
                    <div className="card-text">
                        {body}
                        {space}
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Card
